	(288, '_options_itens_sustentabilidade_0_imagem', 'field_5ad6c19e4624f', 'no'),
	(289, 'options_itens_sustentabilidade_0_conteudo', 'We invest in forestry assets that can be managed according to best-practice standards with regard to environmental conservation and socio-economic sustainability. It is our ambition to obtain highly reputable forest certification schemes for sustainable forestry management for all our operations so that we can easily communicate our environmental achievements and sustainable practices to our stakeholders. We expect most of our investments to involve significant afforestation – establishing new forests. We will actively seek out opportunities to make a positive environmental and social contribution.', 'no'),
