	(1, 2, '2018-04-11 22:57:14', '2018-04-12 01:57:14', 'Bem-vindo ao WordPress. Esse é o seu primeiro post. Edite-o ou exclua-o, e então comece a escrever!', 'Olá, mundo!', '', 'publish', 'open', 'open', '', 'ola-mundo', '', '', '2018-04-11 22:57:14', '2018-04-12 01:57:14', '', 0, 'http://mahogany.local.com.br/?p=1', 0, 'post', '', 1),
	(2, 1, '2018-04-11 22:57:14', '2018-04-12 01:57:14', 'Bem-vindo ao WordPress. Esse é o seu primeiro post. Edite-o ou exclua-o, e então comece a escrever!', 'Olá, mundo!', '', 'publish', 'open', 'open', '', 'ola-mundo', '', '', '2018-04-11 22:57:14', '2018-04-12 01:57:14', '', 0, 'http://mahogany.local.com.br/?p=1', 0, 'post', '', 1),
	(3, 1, '2018-04-11 22:57:14', '2018-04-12 01:57:14', 'Este é o exemplo de uma página. É diferente de um post de blog porque é estática e pode aparecer em menus de navegação (na maioria dos temas). A maioria das pessoas começam com uma página \'Sobre\' que as apresenta aos potenciais visitantes do site. Você pode usar algo como:\n\n<blockquote>Oi! Sou um estudante de Biologia e gosto de esportes e natureza. Nos fins de semana pratico futebol com meus amigos no clube local. Eu moro em Valinhos e fiz este site para falar sobre minha cidade.</blockquote>\n\n...ou algo como:\n\n<blockquote>A empresa Logos foi fundada em 1980, e tem provido o comércio local com o que há de melhor em informatização. Localizada em Recife, nossa empresa tem se destacado como um das que também contribuem para o descarte correto de equipamentos eletrônicos substituídos.</blockquote>\n\nComo um novo usuário WordPress, vá ao seu <a href="http://mahogany.local.com.br/wp-admin/">Painel</a> para excluir este conteúdo e criar o seu. Divirta-se!', 'Página de exemplo', '', 'trash', 'closed', 'open', '', 'pagina-exemplo__trashed', '', '', '2018-04-11 23:49:10', '2018-04-12 02:49:10', '', 0, 'http://mahogany.local.com.br/?page_id=2', 0, 'page', '', 0),
